image.addEventListener('load', function () {
    cellsize = parseInt(cellsizerange.value)
    image.width = image.naturalWidth
    image.height = image.naturalHeight
    aspectratio = image.width / image.height
    imagex = (window.innerWidth / 2 - image.width / 2)
    imagey = (window.innerHeight / 2 - image.height / 2)

    checksize()

    imagex *= 3
    imagey *= 3
    image.width *= 3
    image.height *= 3
    scanimage()

})
function checksize() {
    if (image.width <= window.innerWidth && image.height <= window.innerHeight) {
        imagex = (window.innerWidth / 2 - image.width / 2)
        imagey = (window.innerHeight / 2 - image.height / 2)


    }
    // to fit image inside screen
    else if (image.width > window.innerWidth && image.height > window.innerHeight) {

        if (window.innerWidth < window.innerHeight) {
            image.width = window.innerWidth
            image.height = image.width / aspectratio
            imagex = 0
            imagey = (window.innerHeight / 2 - image.height / 2)
        }
        else {

            image.height = window.innerHeight
            image.width = image.height * aspectratio
            imagex = (window.innerWidth / 2 - image.width / 2)
            imagey = 0
        }


    }
    else if (image.width > window.innerWidth && image.height <= window.innerHeight) {

        image.width = window.innerWidth
        image.height = image.width / aspectratio
        imagex = 0
        imagey = (window.innerHeight / 2 - image.height / 2)


    }
    else if (image.height > window.innerHeight && image.width <= window.innerWidth) {
        image.height = window.innerHeight
        image.width = image.height * aspectratio
        imagex = (window.innerWidth / 2 - image.width / 2)
        imagey = 0


    }
}
function scanimage() {
    ctx.drawImage(image, imagex, imagey, image.width, image.height)
    pixels = ctx.getImageData(imagex, imagey, image.width, image.height)
    ctx.clearRect(imagex, imagey, image.width, image.height)
    for (let y = 0; y < image.height; y += cellsize * imageScale) {
        let row = []
        for (let x = 0; x < image.width; x += cellsize * imageScale) {
            let red = pixels.data[(y * 4 * image.width) + x * 4]
            let green = pixels.data[(y * 4 * image.width) + x * 4 + 1]
            let blue = pixels.data[(y * 4 * image.width) + x * 4 + 2]
            let alpha = pixels.data[(y * 4 * image.width) + x * 4 + 3]

            let data = {
                r: red, g: green, b: blue, a: alpha, x: x, y: y
            }
            if (alpha > 0)
                row.push(data)
        }
        scannedpixelsmatrix.push(row)
    }
    for (y = 0; y < scannedpixelsmatrix.length; y++) {
        for (x = 0; x < scannedpixelsmatrix[y].length; x++) {
            particlesarray.push(new particle(scannedpixelsmatrix[y][x].x, scannedpixelsmatrix[y][x].y, scannedpixelsmatrix[y][x].r, scannedpixelsmatrix[y][x].g, scannedpixelsmatrix[y][x].b, scannedpixelsmatrix[y][x].a))
        }
    }
    for (i = 0; i < particlesarray.length; i++) {
        particlesarray[i].draw()
    }
}

class particle {

    constructor(x, y, r, g, b, a) {
        this.x = x + imagex
        this.y = y + imagey
        this.brightness = (r / 255.0) * 0.3 + (g / 255.0) * 0.59 + (b / 255.0) * 0.11
        this.emo = convertCanvasColors(r, g, b)
        this.color = `rgb(${r},${g},${b})`
    }
    draw() {
        ctx.fillStyle = 'rgba(255, 0, 0, 1)'
        ctx.font = `${cellsize * imageScale}px arial`;
        // ctx.font = `${cellsize * imageScale *(1+this.brightness)}px arial`;
        ctx.textAlign = "center"
        // ctx.fillText(this.emo, this.x, this.y);
        ctx.globalCompositeOperation = 'lighter';
        ctx.globalAlpha = this.brightness + .1;
        ctx.fillText(this.emo, this.x, this.y);
    }

}


